import React, { useState } from 'react';
import { Search, MapPin, Square, DollarSign, Filter, Heart, Calendar, Star } from 'lucide-react';

// SpaceCard Component
const SpaceCard = ({ space, onFavorite, isFavorite, onReserve, reservations }) => {
  const [isReserving, setIsReserving] = useState(false);
  const [reservationDates, setReservationDates] = useState({
    startDate: '',
    endDate: ''
  });

  const handleReservationSubmit = () => {
    const { startDate, endDate } = reservationDates;

    if (!startDate || !endDate) {
      alert('Por favor selecciona las fechas de inicio y fin.');
      return;
    }

    const start = new Date(startDate);
    const end = new Date(endDate);

    if (start >= end) {
      alert('La fecha de fin debe ser posterior a la fecha de inicio.');
      return;
    }

    const isConflict = reservations.some(reservation => {
      const reserveStart = new Date(reservation.startDate);
      const reserveEnd = new Date(reservation.endDate);
      return (start <= reserveEnd && end >= reserveStart) &&
             reservation.spaceId === space.id;
    });

    if (isConflict) {
      alert('Este espacio ya est치 reservado en las fechas seleccionadas.');
      return;
    }

    onReserve(space.id, startDate, endDate);
    setIsReserving(false);
    setReservationDates({ startDate: '', endDate: '' });
  };

  return (
    <div className="bg-white rounded-xl shadow-lg overflow-hidden hover:shadow-xl transition-shadow duration-300">
      {/* Image Container */}
      <div className="relative">
        <img
          src={space.image || `/api/placeholder/400/300?text=${encodeURIComponent(space.name)}`}
          alt={space.name}
          className="w-full h-48 object-cover"
        />
        <button
          onClick={(e) => {
            e.stopPropagation();
            onFavorite(space.id);
          }}
          className="absolute top-4 right-4 p-2 bg-white rounded-full shadow-md hover:scale-110 transition-transform duration-200"
        >
          <Heart
            className={`w-5 h-5 ${isFavorite ? 'fill-red-500 text-red-500' : 'text-gray-500'}`}
          />
        </button>
      </div>

      {/* Content */}
      <div className="p-5">
        {/* Header */}
        <div className="mb-4">
          <h3 className="text-xl font-bold text-gray-800 mb-2">
            {space.name}
          </h3>
          <div className="flex items-center text-gray-600 text-sm mb-2">
            <MapPin className="w-4 h-4 mr-1" />
            <span>{space.location}</span>
            <Square className="w-4 h-4 ml-4 mr-1" />
            <span>{space.type}</span>
          </div>
        </div>

        {/* Price and Rating */}
        <div className="flex justify-between items-center mb-4">
          <div className="flex items-center">
            <DollarSign className="w-5 h-5 text-green-600" />
            <span className="text-xl font-bold text-green-600">
              ${space.price}/mes
            </span>
          </div>
          <div className="flex items-center">
            <Star className="w-5 h-5 text-yellow-400 fill-yellow-400" />
            <span className="ml-1 font-semibold">{space.rating}</span>
          </div>
        </div>

        {/* Description */}
        <p className="text-gray-600 text-sm mb-4">
          {space.description}
        </p>

        {/* Reservation Form */}
        {isReserving ? (
          <div className="space-y-3">
            <div className="flex gap-2">
              <div className="flex-1">
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Inicio
                </label>
                <input
                  type="date"
                  className="w-full p-2 border rounded-md"
                  value={reservationDates.startDate}
                  onChange={(e) => setReservationDates({
                    ...reservationDates,
                    startDate: e.target.value
                  })}
                />
              </div>
              <div className="flex-1">
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Fin
                </label>
                <input
                  type="date"
                  className="w-full p-2 border rounded-md"
                  value={reservationDates.endDate}
                  onChange={(e) => setReservationDates({
                    ...reservationDates,
                    endDate: e.target.value
                  })}
                />
              </div>
            </div>
            <div className="flex gap-2">
              <button
                onClick={handleReservationSubmit}
                className="flex-1 bg-blue-600 text-white py-2 px-4 rounded-md hover:bg-blue-700 transition-colors"
              >
                Confirmar
              </button>
              <button
                onClick={() => setIsReserving(false)}
                className="flex-1 bg-gray-200 text-gray-800 py-2 px-4 rounded-md hover:bg-gray-300 transition-colors"
              >
                Cancelar
              </button>
            </div>
          </div>
        ) : (
          <div className="flex gap-2">
            <button
              onClick={() => setIsReserving(true)}
              className="flex-1 bg-blue-600 text-white py-2 px-4 rounded-md hover:bg-blue-700 transition-colors flex items-center justify-center gap-2"
            >
              <Calendar className="w-4 h-4" />
              Reservar
            </button>
          </div>
        )}
      </div>
    </div>
  );
};

// HomePage Component
const HomePage = ({ spaces, onFavorite, favorites, onReserve, reservations }) => {
  const [searchTerm, setSearchTerm] = useState('');
  const [filters, setFilters] = useState({
    type: 'all',
    priceRange: 'all',
    location: 'all'
  });

  const locations = [...new Set(spaces.map(space => space.location))];
  const types = [...new Set(spaces.map(space => space.type))];

  const filterSpaces = () => {
    return spaces.filter(space => {
      const matchesSearch = space.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
                          space.description.toLowerCase().includes(searchTerm.toLowerCase());
      const matchesType = filters.type === 'all' || space.type === filters.type;
      const matchesLocation = filters.location === 'all' || space.location === filters.location;
      const matchesPrice = filters.priceRange === 'all' ||
                          (filters.priceRange === 'under100' && space.price < 100) ||
                          (filters.priceRange === '100-200' && space.price >= 100 && space.price <= 200) ||
                          (filters.priceRange === 'over200' && space.price > 200);

      return matchesSearch && matchesType && matchesLocation && matchesPrice;
    });
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Hero Section */}
      <div className="bg-gradient-to-r from-blue-600 to-blue-800 text-white py-20">
        <div className="container mx-auto px-4">
          <h1 className="text-4xl md:text-6xl font-bold mb-6">
            Encuentra el espacio perfecto para tus pertenencias
          </h1>
          <p className="text-xl md:text-2xl mb-8 text-blue-100">
            Garajes y espacios de almacenamiento seguros cerca de ti
          </p>

          {/* Search Bar */}
          <div className="bg-white rounded-lg p-2 flex items-center shadow-lg max-w-3xl">
            <Search className="text-gray-400 ml-2" />
            <input
              type="text"
              placeholder="Busca por ubicaci칩n o tipo de espacio..."
              className="flex-1 p-2 outline-none"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
            <button className="bg-blue-600 text-white px-6 py-2 rounded-md hover:bg-blue-700 transition">
              Buscar
            </button>
          </div>
        </div>
      </div>

      {/* Filters Section */}
      <div className="container mx-auto px-4 py-8">
        <div className="bg-white rounded-lg shadow p-6 mb-8">
          <div className="flex flex-wrap gap-4 items-center">
            <div className="flex items-center gap-2">
              <Filter className="text-gray-400" />
              <span className="font-semibold">Filtros:</span>
            </div>

            {/* Type Filter */}
            <select
              className="p-2 border rounded-md"
              value={filters.type}
              onChange={(e) => setFilters({...filters, type: e.target.value})}
            >
              <option value="all">Todos los tipos</option>
              {types.map(type => (
                <option key={type} value={type}>
                  {type.charAt(0).toUpperCase() + type.slice(1)}
                </option>
              ))}
            </select>

            {/* Location Filter */}
            <select
              className="p-2 border rounded-md"
              value={filters.location}
              onChange={(e) => setFilters({...filters, location: e.target.value})}
            >
              <option value="all">Todas las ubicaciones</option>
              {locations.map(location => (
                <option key={location} value={location}>{location}</option>
              ))}
            </select>

            {/* Price Range Filter */}
            <select
              className="p-2 border rounded-md"
              value={filters.priceRange}
              onChange={(e) => setFilters({...filters, priceRange: e.target.value})}
            >
              <option value="all">Todos los precios</option>
              <option value="under100">Menos de $100</option>
              <option value="100-200">$100 - $200</option>
              <option value="over200">M치s de $200</option>
            </select>
          </div>
        </div>

        {/* Results Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {filterSpaces().map(space => (
            <SpaceCard
              key={space.id}
              space={space}
              onFavorite={onFavorite}
              isFavorite={favorites.includes(space.id)}
              onReserve={onReserve}
              reservations={reservations}
            />
          ))}
        </div>
      </div>
    </div>
  );
};

export default HomePage;
